import React from 'react';
import { Chart } from "react-google-charts";

// Sample data for the table
const data = [
  ["Name", "Position", "Office", "Age", "Start date", "Salary"],
  ["John Doe", "System Architect", "New York", 41, "2011/04/25", "$320,800"],
  ["Jane Smith", "Accountant", "Tokyo", 33, "2011/07/25", "$170,750"],
  ["Michael Johnson", "Software Engineer", "London", 29, "2011/08/12", "$86,000"],
  ["Chris Lee", "CEO", "San Francisco", 50, "2009/12/02", "$1,200,000"],
  ["Laura Jackson", "Developer", "Berlin", 23, "2014/03/12", "$140,000"],
];

const options = {
  showRowNumber: true, // Shows row numbers
  width: "100%", // Table width
  height: "100%", // Table height
};

const Table = () => {
  return (
    <div className="table-container">
      <Chart
        chartType="Table"
        width="100%"
        height="400px"
        data={data}
        options={options}
        loader={<div>Loading Table...</div>} // Loader while chart is rendering
      />
    </div>
  );
};

export default Table;
